INSERT INTO `products`(`productname`, `productdescription`, `stock`, `price`, `mainimage`, `productcategory_idproductcategory`) VALUES ('Raw replica - str. ø36','Istandsat Københavnerlampe med et råt brunt replika mønster.   Håndslebet for at give mere "råhed" i mange brune fantastiske nuancer.  Otto Käszner, født 1938, ´Københavnerlampen´ af patineret glasfiber med topdæksel af håndskåret træ. Fås i enten Ø46 eller Ø36.   Industriel lampe tegnet af stadsarkitekt Otto Käszner, fremstillet til Københavns Kommune ca. 1970, mere specifikt af Phillips. Fremstår renoveret med ny sort, gummieret ledning, NKT wire-ophæng, glasbund samt konverteret til 230v med isat E27 fatning.   Hånddrejede trætoppe monteres af vores eget design.   Disse fås i forskellige varianter såsom: Eg, Ibenholt, rødtræ eller teak!  *NB* Forsendelse er IKKE med i disse priser. Skal afhentes I KBH K, Odense C eller Sdr. Jylland. Medmindre andet aftales.',1,1300,'images/produkter/lamper/rawreplica/rawreplicamain.jpg',1);
