INSERT INTO `products`(`productname`, `productdescription`, `stock`, `price`, `mainimage`, `productcategory_idproductcategory`) VALUES ('Renoveret gammel teak skænk','En lidt ældre teak/nødde skænk der har fået en omgang lak, pudset og rengjort.  Super fed som sengeskænk! Lækker lille kæde til at åbne nederste låge med.  *NB* Forsendelse er IKKE med i disse priser. Skal afhentes I KBH K, Odense C eller Sdr. Jylland. Medmindre andet aftales.',1,799,'images/produkter/skaenk/renoveretgammelteak/skaenkmain.jpg',2);
